import React from 'react'
import { useLocation, useNavigate } from 'react-router-dom';
import '../App.css';

function Dashboard() {
  const { state } = useLocation();
  const { marks, message, result } = state.response;

  const navigate = useNavigate();

  if(!localStorage.getItem("TOKEN")){
    navigate("/login");
  }
  
  return (
    <div>
      <button style={{float:"right"}}></button>
      <h2>This is dashboard</h2>
      <table>
        <thead>
          <tr>
            <th>Sub1</th>
            <th>Sub2</th>
            <th>Sub3</th>
            <th>Sub4</th>
            <th>Sub5</th>
            <th>Sub6</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{marks.sub1}</td>
            <td>{marks.sub2}</td>
            <td>{marks.sub3}</td>
            <td>{marks.sub4}</td>
            <td>{marks.sub5}</td>
            <td>{marks.sub6}</td>
          </tr>
        </tbody>
      </table>
      {console.log(message)}
      {console.log(result)}
    </div>

  )
}

export default Dashboard
